import React, { Component } from 'react';
import './App.css';
import Todoapp from "./component/Todoapp";
class App extends Component {
  constructor(props) {
    super(props);
    this.title = [
      { title: 'mua banh', isComplete: true},
      { title : 'mua keo',},
      { title : 'mua bim bim',}
    ]
  }

  render() {
    return (
      <div className="App">
        <Todoapp/>
      </div>
    );
  }
}

export default App;
